import { MDBContainer } from 'mdbreact';
import React from 'react';
import {Route} from 'react-router-dom'
import { registerAdmin } from '../actions/authActions';
import addItem from './../components/addItem';
import NewAdminRegister from './NewAdmin';
import SideNavigation from './sideNavigation copy';
import TopNavigation from './TopNavigation';
import {connect}from'react-redux';

const AdminRoutes = ({render:Component,isAuth,...rest}) => {
    return ( <>
    { this.props.isAuth?

    <React.Fragment>
         <SideNavigation />      
          <main id="content" className="p-10" >
          <TopNavigation />
          <MDBContainer>
        <Route path={`${this.props.match.path}/addItem`} component={addItem}/>
        <Route path={`${this.props.match.path}/newadmin`} component={NewAdminRegister}/>
        </MDBContainer>
    </main>
    </React.Fragment>
    :null}
    </> );
}
const mapStateToProps=(state)=>{
    return {
isAuth:state.auth.isAuthenticated
    }
}

export default connect(mapStateToProps,null)(AdminRoutes);
